import React, { useRef, useState, useEffect } from "react";
import { motion, useScroll, useTransform, useSpring, AnimatePresence, useMotionValue, useDragControls, useInView } from "framer-motion";
import Header from "./Header";
import InteractiveLines from "./InteractiveLines-p";
import Footer from "./Footer";
import { Link } from "react-router-dom";

const Pawmeet: React.FC = () => {
  const { scrollY } = useScroll();
  const scrollX = useTransform(scrollY, [0, 400], [0, -200]);
  const xSpring = useSpring(scrollX, { stiffness: 100, damping: 30 });
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const [currentDesignIndex, setCurrentDesignIndex] = useState(0);
  const topImages = ["/p-1.png", "/p-2.png", "/p-3.png"];
  const designImages = ["/p_1.png", "/p_2.png", "/p_3.png", "/p_4.png"];
  const dragControls = useDragControls();
  const dragX = useMotionValue(0);

  // Add refs for each section
  const heroRef = useRef(null);
  const uiSectionRef = useRef(null);
  const aboutSectionRef = useRef(null);
  const typographySectionRef = useRef(null);
  const designSectionRef = useRef(null);

  // Add inView hooks for each section
  const heroInView = useInView(heroRef, { once: true, amount: 0.3 });
  const uiSectionInView = useInView(uiSectionRef, { once: true, amount: 0.3 });
  const aboutSectionInView = useInView(aboutSectionRef, { once: true, amount: 0.3 });
  const typographySectionInView = useInView(typographySectionRef, { once: true, amount: 0.3 });
  const designSectionInView = useInView(designSectionRef, { once: true, amount: 0.3 });

  // Auto-rotation effect for top images
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImageIndex((prevIndex) => (prevIndex + 1) % topImages.length);
    }, 3000);

    return () => clearInterval(interval);
  }, []);

  // Simple navigation functions
  const goToNextSlide = () => {
    setCurrentDesignIndex((currentDesignIndex + 1) % designImages.length);
  };

  const goToPrevSlide = () => {
    setCurrentDesignIndex((currentDesignIndex - 1 + designImages.length) % designImages.length);
  };

  const goToSlide = (index: number) => {
    setCurrentDesignIndex(index);
  };

  const scrollToProjects = () => {
    window.location.href = '/';
    setTimeout(() => {
      const projectsSection = document.getElementById('projects');
      if (projectsSection) {
        projectsSection.scrollIntoView({ behavior: 'smooth' });
      }
    }, 100);
  };

  return (
    <div className="relative min-h-screen bg-[#F4F1EC]">
      <Header />
      <motion.section 
        ref={heroRef}
        className="relative w-full min-h-[100vh] h-screen overflow-hidden"
        initial={{ opacity: 0 }}
        animate={{ opacity: heroInView ? 1 : 0 }}
        transition={{ duration: 1 }}
      >
        <InteractiveLines />
        <div className="absolute inset-0 flex items-center justify-center">
          <motion.div
            className="relative z-20 translate-y-50"
            animate={{
              y: [0, -20, 0],
              scale: [1, 1.1, 1],
            }}
            transition={{
              duration: 4,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          >
            <motion.img 
              src="/card1.png" 
              alt="Card" 
              className="w-80 h-auto"
              whileHover={{
                scale: 1.1,
                transition: {
                  duration: 0.3,
                  ease: "easeOut"
                }
              }}
            />
          </motion.div>
        </div>
        <motion.h1
          className="relative z-10 text-[40vw] md:text-[35vw] lg:text-[30vw] font-serif font-bold text-right mt-[45vh] md:mt-[25vh] pr-[5vw] whitespace-nowrap"
          style={{ x: xSpring }}
        >
          PAWMEET
        </motion.h1>
      </motion.section>
      
      <motion.section 
        ref={uiSectionRef}
        className="relative w-full h-[800px] bg-gradient-to-b from-[#8BE644] via-[#F5F2ED] via-[#F5F2ED] via-[#F5F2ED] via-[#F5F2ED] to-[#F5F2ED] py-10 px-8 flex items-center justify-center overflow-hidden"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: uiSectionInView ? 1 : 0, y: uiSectionInView ? 0 : 50 }}
        transition={{ duration: 1 }}
      >
        {/* Background paw prints */}
        <div className="absolute w-[280px] h-[280px] left-20 bottom-20 rotate-[-15deg]">
          <img 
            src="/p-bg.png" 
            alt="Background Paw Print" 
            className="w-full h-full object-contain"
          />
        </div>
        <div className="absolute w-[280px] h-[280px] right-20 top-20 rotate-[15deg]">
          <img 
            src="/p-bg.png" 
            alt="Background Paw Print" 
            className="w-full h-full object-contain"
          />
        </div>

        <div className="absolute top-10 w-full overflow-hidden">
          <motion.div 
            className="whitespace-nowrap text-4xl font-light italic font-inter text-black"
            initial={{ x: "100%" }}
            animate={{ x: "-100%" }}
            transition={{
              duration: 20,
              repeat: Infinity,
              ease: "linear"
            }}
          >
            Front-end and Back-end Development
          </motion.div>
        </div>
        
        <div className="relative flex items-center justify-center">
          <motion.div
            initial={{ y: -100, opacity: 0 }}
            animate={{ y: 0, opacity: 1 }}
            transition={{
              duration: 1,
              ease: "easeOut"
            }}
            className="absolute -top-40 w-[600px] h-[600px] z-20"
          >
            <AnimatePresence mode="wait">
              <motion.img 
                key={currentImageIndex}
                src={topImages[currentImageIndex]}
                alt={`Project Image ${currentImageIndex + 1}`}
                className="w-full h-full object-contain"
                loading="eager"
                decoding="sync"
                initial={{ opacity: 0, scale: 0.8 }}
                animate={{ opacity: 1, scale: 1 }}
                exit={{ opacity: 0, scale: 0.8 }}
                transition={{
                  duration: 0.5,
                  ease: "easeInOut"
                }}
              />
            </AnimatePresence>
          </motion.div>
          <h1 className="text-[120px] font-semibold italic font-inter">UI/UX DESIGN</h1>
        </div>
      </motion.section>

      <motion.section 
        className="relative w-full h-[500px]"
        initial={{ opacity: 0 }}
        animate={{ opacity: uiSectionInView ? 1 : 0 }}
        transition={{ duration: 1 }}
      >
        <img 
          src="/p-bg2.png" 
          alt="Background" 
          className="w-full h-full object-cover object-center"
        />
      </motion.section>

      <motion.section 
        ref={aboutSectionRef}
        className="relative w-full min-h-screen bg-[#F5F5F0] py-20 px-8"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: aboutSectionInView ? 1 : 0, y: aboutSectionInView ? 0 : 50 }}
        transition={{ duration: 1 }}
      >
        <div className="max-w-7xl mx-auto flex items-center gap-8">
          <div className="flex-1 pl-32 -mt-20">
            <div className="w-80 h-[2px] bg-[#8BE644] mb-8"></div>
            <div className="flex items-center gap-4 mb-8">
              <img 
                src="/paw.png" 
                alt="Paw Icon" 
                className="w-12 h-12"
              />
              <h2 className="text-6xl font-bold">About</h2>
            </div>
            <p className="text-xl leading-relaxed italic text-gray-700">
              "PAWMEET" is a pet social networking app designed to help pet owners find 
              compatible playmates for their pets and connect within a pet-friendly community. 
              Users can help their pets match playmates, arrange playdates, access 
              pet-related services.
            </p>
          </div>
          
          <div className="flex-1 flex justify-center">
            <div className="relative w-[250px]">
              <img 
                src="/p-mobile.png" 
                alt="Phone Mockup" 
                className="w-full h-auto"
              />
            </div>
          </div>
        </div>
      </motion.section>

      <motion.section 
        ref={typographySectionRef}
        className="relative w-full min-h-screen bg-[#F5F5F0] px-8 -mt-40"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: typographySectionInView ? 1 : 0, y: typographySectionInView ? 0 : 50 }}
        transition={{ duration: 1 }}
      >
        <div className="max-w-7xl mx-auto">
          {/* Typography Section */}
          <div className="mb-20 -ml-24">
            <div className="w-80 h-[2px] bg-[#8BE644] mb-4 ml-24 mt-8"></div>
            <div className="grid gap-16">
              <div className="font-epilogue">
                <h3 className="text-[8vw] tracking-wide italic mb-4">AaBbCcDdEeFfGgHhIiJjKkLl</h3>
                <p className="text-xl text-gray-600 italic ml-24">Epilogue</p>
              </div>
              <div>
                <h3 className="font-inter text-[8vw] tracking-wide mb-4">AaBbCcDdEeFfGgHhIiJjKkLl</h3>
                <p className="text-xl text-gray-600 italic ml-24">Inter</p>
              </div>
            </div>
          </div>

          {/* Color Palette */}
          <div className="mb-20">
            <div className="flex w-full gap-8">
              <div className="w-[40%] grid grid-cols-2 gap-10">
                <div className="w-full h-40 bg-[#1E1E1E] relative rounded-[16px]">
                  <span className="absolute bottom-1 left-1 text-white text-xs">#1E1E1E</span>
                </div>
                <div className="w-full h-40 bg-[#BCEF94] border border-black relative rounded-[16px]">
                  <span className="absolute bottom-1 left-1 text-black text-xs">#BCEF94</span>
                </div>
                <div className="w-full h-40 bg-[#F2F2F2] border border-black relative rounded-[16px]">
                  <span className="absolute bottom-1 left-1 text-black text-xs">#F2F2F2</span>
                </div>
                <div className="w-full h-40 bg-[#61BC19] relative rounded-[16px]">
                  <span className="absolute bottom-1 left-1 text-white text-xs">#61BC19</span>
                </div>
              </div>
              <div className="w-[60%] h-[360px] bg-[#8BE644] flex items-center justify-center relative rounded-[16px]">
                <img 
                  src="/paw-white.png" 
                  alt="White Paw" 
                  className="w-60 h-60 object-contain"
                />
                <span className="absolute bottom-1 left-1 text-black text-xs">#8BE644</span>
              </div>
            </div>
          </div>
        </div>
      </motion.section>

      <motion.div 
        ref={designSectionRef}
        className="w-screen -mx-8"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: designSectionInView ? 1 : 0, y: designSectionInView ? 0 : 50 }}
        transition={{ duration: 1 }}
      >
        <div className="bg-black p-24 rounded-lg shadow-lg w-full min-h-[600px] flex items-center justify-center overflow-hidden">
          <div className="relative w-full h-full flex items-center justify-center">
            <AnimatePresence mode="wait">
              <motion.div
                key={currentDesignIndex}
                className="absolute flex justify-center items-center"
                initial={{ opacity: 0, x: 100 }}
                animate={{ opacity: 1, x: 0 }}
                exit={{ opacity: 0, x: -100 }}
                transition={{ duration: 0.5, ease: "easeInOut" }}
              >
                <img
                  src={designImages[currentDesignIndex]}
                  alt={`Design ${currentDesignIndex + 1}`}
                  className="h-[500px] w-auto object-contain"
                />
              </motion.div>
            </AnimatePresence>
            
            {/* Navigation overlay buttons */}
            <button 
              onClick={goToPrevSlide}
              className="absolute left-4 top-1/2 -translate-y-1/2 bg-[#BCEF94]/70 hover:bg-[#BCEF94]/90 text-black w-16 h-16 flex items-center justify-center border-2 border-white/80 transition-all z-10 shadow-md text-2xl rounded-[10px]"
              aria-label="Previous design"
            >
              &lt;
            </button>
            <button 
              onClick={goToNextSlide}
              className="absolute right-4 top-1/2 -translate-y-1/2 bg-[#BCEF94]/70 hover:bg-[#BCEF94]/90 text-black w-16 h-16 flex items-center justify-center border-2 border-white/80 transition-all z-10 shadow-md text-2xl rounded-[10px]"
              aria-label="Next design"
            >
              &gt;
            </button>
          </div>
        </div>
        
        {/* Navigation dots */}
        <div className="flex justify-center mt-6 gap-4 items-center">
          <div className="flex gap-2 items-center">
            {designImages.map((_, index) => (
              <button
                key={`dot-${index}`}
                onClick={() => goToSlide(index)}
                className={`w-3 h-3 rounded-[4px] ${index === currentDesignIndex ? 'bg-[#8BE644]/90 border border-white/80' : 'bg-gray-400/70 border border-white/60'}`}
                aria-label={`Go to design ${index + 1}`}
              />
            ))}
          </div>
        </div>
        
        <div className="flex justify-center mt-8 mb-24">
          <button 
            onClick={scrollToProjects}
            className="bg-[#BCEF94]/90 text-black border-2 border-black/90 px-10 py-4 font-serif text-base font-medium transition-all duration-300 ease-in-out hover:-translate-y-1 hover:shadow-[0_8px_0_0_rgba(0,0,0,0.8)] hover:bg-[#BCEF94] active:translate-y-0 active:shadow-[0_1px_0_0_rgba(0,0,0,0.8)] rounded-[20px]"
          >
            VIEW ALL PROJECTS
          </button>
        </div>
      </motion.div>
      <Footer />
    </div>
  );
};

export default Pawmeet;
